import React from 'react'

export default function RsvpListItem(props) {
  return (
    <li key={props.key} className='dropdown' onClick={() => props.setSelected(props.person)}>
      <span><button className='dropbtn'>{props.person.name}</button>
        <button>Remove</button>
      </span>
      <div className='dropdown-content'>
        <a href='#'>{props.person.email}</a>
      </div>
    </li>
  )
}
